
-- AT 6
-- State 1,2

alter table area_of_concern add column foo int null;
alter table standard add column foo int null;
alter table measurable_element add column foo int null;

insert into department (name) values ('ANC OPD');
insert into checklist (name, department_id, assessment_tool_id, state_id) VALUES ('ANC OPD', (select id from department where name = 'ANC OPD'), 6, 1);
-- insert into checklist (name, department_id, assessment_tool_id, state_id) VALUES ('ANC OPD', (select id from department where name = 'ANC OPD'), 6, 2);

insert into area_of_concern (name, reference, assessment_tool_id, foo) select name, reference, 6, 1 from area_of_concern where assessment_tool_id = 1 order by id limit 8;

insert into standard (name, reference, area_of_concern_id, assessment_tool_id, short_name, foo)
  select bar.name, bar.reference, area_of_concern.id, 6, bar.short_name, 1 from
    (select name, reference, short_name from standard where assessment_tool_id = 1 order by id limit 70) bar
    inner join area_of_concern on area_of_concern.foo = 1 and area_of_concern.reference = substring(bar.reference from 1 for 1);

insert into measurable_element (name, reference, standard_id, assessment_tool_id, foo)
  select bar.name, bar.reference, standard.id, 6, 1 from
    (select name, reference from measurable_element where assessment_tool_id = 1 order by id limit 311) bar
    inner join standard on standard.foo = 1 and standard.reference = split_part(bar.reference, '.', 1);

